create table taxonaccepted
(
    acceptedid     integer      not null
        constraint taxonaccepted_pkey
            primary key,
    nameaccepted   varchar(120) not null
        constraint taxonaccepted_nameaccepted_key
            unique,
    authacceptedid integer      not null
        constraint taxonaccepted_authacceptedid_fkey
            references author,
    hierarchyid    smallint     not null
        constraint taxonaccepted_hierarchyid_fkey
            references hierarchy,
    taxonsourceid  smallint
        constraint taxonaccepted_taxonsourceid_fkey
            references taxonsource,
    linksource     varchar(255),
    levelid        smallint     not null
        constraint taxonaccepted_levelid_fkey
            references taxonlevel,
    habitid        smallint     not null
        constraint taxonaccepted_habitid_fkey
            references habit,
    native         boolean      not null,
    non_native     boolean      not null
);

alter table taxonaccepted
    owner to postgres;

